import axios from "axios"
import React,{ useEffect, useState } from "react";
import './static/Projects.css'
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome"
import { faMagnifyingGlass } from "@fortawesome/free-solid-svg-icons"
const Table = (props)=>{
    const Projects = props.Data.filter((item)=>{
        return item.category === props.category
    })
    return(
        <>
        <table>
            <tr>
                <th>S.no</th><th className="title">Title</th><th>Category</th><th>Sub Category</th><th>View</th>
            </tr>
            {Projects.map((project)=>(<tbody>
            <tr key={project._id}>
             <td className="sno">1.</td>   
            <td className="b_title">{project.title}</td>
            <td>{project.category}</td>
            <td>{project.sub_category}</td>
            <td><a target="_blank" href={project.video}>View</a></td>
            </tr>
            </tbody>))}
        </table>
        </>
    )
}

const Projects = (props)=>{
    const [Data,SetData] = useState([]);
    const [Search,SetSearch] = useState([]);
    async function fetchProduct(){
        const response = await axios.get("http://localhost:5000/view/view_product");
        SetData(response.data)
        SetSearch(response.data)
    }

    useEffect(()=>{
        fetchProduct()
    },[])
    const handleSearch = (e) =>{
        if (!e.target.value) return SetSearch(Data)
            const resultsArray = Data.filter(post => post.title.includes(e.target.value) || post.body.includes(e.target.value))
            SetSearch(resultsArray)
    }
    const handleSubmit = e =>e.preventDefault()
    return(
        <>
        <h2>List of IEEE Projects (2024-2025)</h2>
        <div className="list">
           <form onSubmit={handleSubmit}> <label>Search:</label>
            <input type="text" className="search" onChange={handleSearch}/>
            
            </form>
        <ul>
            {props.Categories.map((cat)=>(
                <div key={cat._id} className="categoru">
                    <h4 className="cats">{cat.category}</h4>
                    <Table Data={Data} category={cat.category}/>
                </div>))}
        </ul></div>
        </>
    )
}
export default Projects;
